import "./App.css";
import { BrowserRouter, Route, Routes } from "react-router-dom";
import Nav from "./components/Nav";
function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Nav />
        <Routes>
          <Route path="/" element={<h1>Heelo</h1>}></Route>
          <Route path="/add" element={<h1>Add</h1>}></Route>
          <Route path="/update" element={<h1>Update</h1>}></Route>
          <Route path="/delete" element={<h1>Delete</h1>}></Route>
          <Route path="/profile" element={<h1>Profile</h1>}></Route>
          <Route path="/logout" element={<h1>Logout</h1>}></Route>
          <Route path="/singup" element={<h1>Singup</h1>}></Route>
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
